tables.table_schema:
CREATE TABLE ethical_issues_list (
   id INT PRIMARY KEY,
   issue_name VARCHAR(255),
   description TEXT
);

CREATE TABLE EthicalConsiderations (
    id INT PRIMARY KEY,
    decision_process VARCHAR(255),
    ethical_impact TEXT
);

CREATE TABLE Stakeholders (
    id INT PRIMARY KEY,
    stakeholder_name VARCHAR(255),
    role VARCHAR(255)
);

CREATE TABLE AI_Algorithms (
    id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    algorithm_type VARCHAR(255),
    complexity VARCHAR(100)
);

CREATE TABLE ethic_considerations_ai_decision_making(
  id INT PRIMARY KEY,
  ethical_principle TEXT,
  explanation TEXT
);

CREATE TABLE ai_ethical_issues(
  id INT PRIMARY KEY,
  issue_name TEXT,
  description TEXT
);

CREATE TABLE ai_decision_data(
  id INT PRIMARY KEY,
  decision_id INT,
  data_type TEXT,
  data_value TEXT
);

CREATE TABLE ai_decision_feedback(
  id INT PRIMARY KEY,
  decision_id INT,
  feedback TEXT,
  sentiment_analysis TEXT
);

CREATE TABLE ethical_considerations_ai_decision_making (
    id INT PRIMARY KEY,
    ethical_framework TEXT,
    decision_process TEXT,
    ethical_issues TEXT
);

CREATE TABLE ethical_frameworks (
    id INT PRIMARY KEY,
    framework_name TEXT,
    description TEXT
);

CREATE TABLE decision_making_models (
    id INT PRIMARY KEY,
    model_name TEXT,
    algorithm TEXT,
    description TEXT
);

CREATE TABLE stakeholders (
    id INT PRIMARY KEY,
    stakeholder_name TEXT,
    role TEXT,
    organization TEXT
);
